sys_variable_value.value:
(function execute(inputs, outputs) {
    inputs = new JenkinsUtils().trimStringInputs(inputs);
    outputs.new_name = inputs.new_name;
  try{
    inputs.current_job_path = inputs.current_job_path.replace(/^\/|\/$/g,
        '');
    var job_path = "";
    if (inputs.current_job_path.contains("/")) {
        var parent_jobs = inputs.current_job_path.split('/');
        for (var i = 0; i < parent_jobs.length; i++) {
            job_path += "/job/" + parent_jobs[i];
        }
        outputs.current_job_path = job_path.toString();
    } else {
        outputs.current_job_path = "/job/" + inputs.current_job_path
            .toString();
    }
  }catch(e){
  	new JenkinsUtils().throwError('rename_job');
  }
})(inputs, outputs);

